import React from "react";
import "./style.css";

function AlistHeader(props) {
    return (
      <div className="hero text-center" style={{ backgroundImage: `url(${props.backgroundImage})` }}>
        {props.children}
      </div>
    );
  }

  export default AlistHeader;
